import React from 'react'
import App from './App'
import styled from 'styled-components'

const WeeklyScore = () => {
    return (
        <MyWrap>
            <h1>내 일주일은?</h1>
            <MyDays>
                <div>월</div>
                <div>화</div>
                <div>수</div>
                <div>목</div>
                <div>금</div>
                <div>토</div>
                <div>일</div>
            </MyDays>
        </MyWrap>
    )

}

const MyWrap = styled.div`
    width: 500px;
    height: 700px;
    text-align: center;
    margin: 0px auto;

    h1{
        color: darkslateblue;
    }
`
const MyDays = styled.div`
    font-size: 1.5em;
`
export default WeeklyScore;
